import React from 'react';

const Header = ({ weekDate }) => {
  let weekDateSplit = weekDate.split('-');
  const { week, year } = weekDate.split('-');
  return (
    <div className='header'>
      <h1 className='f1 tl title ml3'>HBC Coffee Week</h1>
      <h1 className='f1 tl ml3' id='divider'>|</h1>
      <h1 className='f1 tl ml3' id='weekIndicator'>Week {week} {year}</h1>
    </div>
  );
}

export default Header;
